import React, { useEffect } from 'react'
import { useSelector } from 'react-redux'
import { VideoPreview } from './VideoPreview'

export function FavoritesList({ setCurrVideo }) {
    const { favorites } = useSelector(state => state.listModule)
    useEffect(() => {
        console.log('favorites is:', favorites);
    }, [favorites])
    if (!favorites) return <div>Dont have Favorites video </div>
    return (
        <div>
            {favorites.map(video => {
                return <div>
                    <img className="video-img" src={video.snippet.thumbnails.default.url} alt="img-video" />

                </div>
                // return <VideoPreview key={video.id.videoId} video={video} setCurrVideo={setCurrVideo} />
            })}
        </div>
    )
}
